import React from "react";
import { View, Text } from "react-native";

function BottomTabs(props) {
  return (
    <View>
      <View
        style={{
          borderBottomColor: "black",
          borderBottomWidth: 5,
        }}
      />
      <View
        style={{
          flexDirection: "row",
          justifyContent: "space-between",
          margin: 10,
          marginHorizontal: 10,
        }}
      >
        <Icon></Icon>
        <Icon></Icon>
        <Icon></Icon>
        <Icon></Icon>
      </View>
    </View>
  );
}

const Icon = () => {
  return (
    <View>
      <Text>BOTTOM</Text>
    </View>
  );
};

export default BottomTabs;
